import React from 'react';
import styled from 'styled-components';

const Footer = () => {
  return (
    <FooterContainer>
      <p>&copy; 2024 Track BTC Price</p>
    </FooterContainer>
  );
};

const FooterContainer = styled.footer`
  position: absolute;
  bottom: 0;
  width: 100%;
  padding: 10px;
  text-align: center;
  background-color: #282c34;
  color: #61dafb;
`;

const BodyContainer = styled.div`
  background-color: #f0f0f0; /* Set your background color here */
  min-height: 0; /* Ensure that the background covers the entire viewport */
`;

export default function App() {
  return (
    <BodyContainer>
      {/* Your content here */}
      <Footer />
    </BodyContainer>
  );
}
